info:
  title: Documentation API
  description: Byecheating is an API to manage cheating detection data through RTSP protocol. It enables live streaming analysis, frame-level predictions, and storage of activity reports. This API is part of a system built to track, monitor, and record suspicious behavior during remote sessions.
  contact:
    email: d.nta.workspace@gmail.com
  license:
    name: Apache 2.0
    url: https://www.apache.org/licenses/LICENSE-2.0.html
  version: 1.0.0
servers:
  - url: http://localhost:8080
  - url: http://{{hostdocker}}
  - url: http://{{host}}
