      summary: '[Admin] Get user list'
      description: >-
        ## Get User List


        This endpoint retrieves a list of users from the server.


        ### Request


        - **Method**: `GET`
            
        - **Endpoint**: `{{hostDocker}}/user/list`
            

        ### Response


        The response will return a JSON object with the following structure:


        - **success**: A boolean indicating whether the request was successful.
            
        - **result**: An array containing user objects. Each user object may
        include the following fields:
            
            - **id**: The unique identifier for the user.
                
            - **email**: The email address of the user.
                
            - **name**: The name of the user.
                
            - **roles**: An array of roles assigned to the user.
                
            - **isVerified**: A boolean indicating if the user has verified their account.
                
            - **createdDate**: The date when the user was created.
                
            - **updatedDate**: The date when the user information was last updated (can be null).
                
            - **photo**: The URL or path to the user's profile photo (can be null).
                

        ### Example Responses


        1. { "success": true, "result": \[\]}
            
        2. { "success": true, "result": \[ { "id": "", "email": "", "name": "",
        "roles": \[\], "isVerified": true, "createdDate": "", "updatedDate":
        null, "photo": null } \]}
            
        3. { "success": true, "result": \[ { "id": "", "email": "", "name": "",
        "roles": \[""\], "isVerified": true, "createdDate": "", "updatedDate":
        null, "photo": null } \]}
            

        This endpoint is useful for retrieving user information for
        administrative purposes or for displaying user profiles in an
        application.
