        ### Get User Information


        This endpoint retrieves information about a user. It is a simple HTTP
        GET request that does not require any request body.


        #### Request


        - **Method**: GET
            
        - **URL**: `{{hostDocker}}/user`
            

        #### Response


        The response will be a JSON object that contains the following fields:


        - **success** (boolean): Indicates whether the request was successful.
            
        - **result** (object): Contains the user details, which includes:
            
            - **id** (string): The unique identifier for the user.
                
            - **email** (string): The user's email address.
                
            - **name** (string): The name of the user.
                
            - **roles** (array): An array of roles assigned to the user.
                
            - **isVerified** (boolean): A flag indicating if the user's email has been verified.
                
            - **createdDate** (string): The date when the user was created.
                
            - **updatedDate** (string or null): The date when the user was last updated, or null if not applicable.
                
            - **photo** (string or null): A URL to the user's profile photo, or null if not available.
                

        #### Example Response


        ``` json

        {
          "success": true,
          "result": {
            "id": "",
            "email": "",
            "name": "",
            "roles": [],
            "isVerified": true,
            "createdDate": "",
            "updatedDate": null,
            "photo": null
          }
        }

         ```

        This endpoint is useful for applications that need to display user
        information, manage user roles, or verify user accounts.


        This endpoint retrieves information about the currently authenticated
        user.


        #### Request


        - **Method**: GET
            
        - **URL**: `{{hostDocker}}/user`
            

        #### Response


        On a successful request, the response will contain:


        - `success`: A boolean indicating whether the request was successful.
            
        - `result`: An object containing user details:
            
            - `id`: The unique identifier of the user.
                
            - `email`: The user's email address.
                
            - `name`: The name of the user.
                
            - `roles`: An array of roles assigned to the user.
                
            - `isVerified`: A boolean indicating if the user's email is verified.
                
            - `createdDate`: The date when the user was created.
                
            - `updatedDate`: The date when the user was last updated (can be null).
                
            - `photo`: A URL or reference to the user's profile photo (can be null).
                

        This endpoint is useful for applications that require user-specific
        information after authentication.
