        #### Request Body


        The request requires a JSON object in the body with the following
        parameter:


        - **name** (string): The new name of the user. This field is mandatory
        for updating the user's information.
            

        **Example Request Body:**


        ``` json

        {
          "name": "Updated User"
        }

         ```

        #### Response


        Upon a successful request, the server will respond with a JSON object
        containing the following fields:


        - **success** (boolean): Indicates whether the update operation was
        successful.
            
        - **result** (object): Contains the updated user details:
            
            - **id** (string): The unique identifier of the user.
                
            - **email** (string): The email address of the user.
                
            - **name** (string): The updated name of the user.
                
            - **roles** (array): An array of roles assigned to the user.
                
            - **isVerified** (boolean): Indicates if the user's email has been verified.
                
            - **createdDate** (string): The date when the user was created.
                
            - **updatedDate** (string): The date when the user information was last updated.
                
            - **photo** (null or string): The URL of the user's profile photo, if available.
                

        **Example Response:**


        ``` json

        {
          "success": true,
          "result": {
            "id": "",
            "email": "",
            "name": "",
            "roles": [],
            "isVerified": true,
            "createdDate": "",
            "updatedDate": "",
            "photo": null
          }
        }

         ```

        #### Notes


        - Ensure that the `name` parameter is provided in the request body to
        successfully update the user information.
            
        - The response will reflect the updated user details, including
        verification status and timestamps.
