      summary: '[Admin] Update User'
      description: >-
        ## Update User Information


        This endpoint allows you to update the details of a user in the system.
        It is a PATCH request that modifies the existing user record based on
        the provided user ID.


        ### Request


        - **Method**: PATCH
            
        - **URL**: `{{hostDocker}}/user/update`
            
        - **Content-Type**: application/json
            

        #### Request Body


        The request body must be in JSON format and should include the following
        parameters:


        - `id` (string): The unique identifier of the user to be updated.
            
        - `name` (string): The new name for the user.
            

        **Example Request Body**:


        ``` json

        {
          "id": "e7478332-9f14-4ada-9f74-7bc724...",
          "name": "Updated User"
        }

         ```

        ### Response


