      summary: Get notification
      description: >-
        ## Get User Notifications


        This endpoint retrieves a list of notifications for the user. It allows
        clients to specify pagination parameters to control the number of
        notifications returned and whether to show only the user's
        notifications.


        ### Request


        **Method:** GET  

        **Endpoint:** `{{hostDocker}}/user/notification`


        #### Query Parameters:


        - **limit** (integer, required): The maximum number of notifications to
        return. In this example, it is set to `1`.
            
        - **page** (integer, required): The page number for pagination. In this
        example, it is set to `1`.
            
        - **isShowMine** (boolean, required): A flag indicating whether to show
        only the notifications related to the authenticated user. In this
        example, it is set to `true`.
            

        ### Response


        The response will be a JSON object with the following structure:


        - **success** (boolean): Indicates whether the request was successful.
            
        - **result** (array): An array containing the notifications. Each
        notification object may have the following fields:
            
            - **id** (string): The unique identifier for the notification.
                
            - **link** (string or null): A URL link associated with the notification.
                
            - **photo** (string or null): A URL to a photo related to the notification.
                
            - **title** (string): The title of the notification.
                
            - **description** (string): A brief description of the notification.
                
            - **caption** (string or null): A caption for the notification.
                
            - **entityId** (string or null): The ID of the entity associated with the notification.
                
            - **entityName** (string or null): The name of the entity associated with the notification.
                
            - **status** (string or null): The current status of the notification.
                
            - **userId** (string): The ID of the user associated with the notification.
                
            - **createdDate** (string): The date when the notification was created.
                

        #### Example Responses:


        1. { "success": true, "result": \[\]}
            
        2. { "success": true, "result": \[ { "id": "", "link": null, "photo":
        null, "title": "", "description": "", "caption": null, "entityId": null,
        "entityName": null, "status": null, "userId": "", "createdDate": "" }
        \]}
            

        This endpoint is useful for users to keep track of their notifications
        and to manage their interactions within the application effectively.
