  /stream:
    get:
      tags:
        - Stream
      summary: Get stream
      description: >-
        # API Endpoint Documentation: Stream Retrieval


        ## Endpoint


        `GET {{hostDocker}}/stream`


        ## Description


        This endpoint retrieves a list of streams based on the specified query
        parameters. It allows users to filter streams by various criteria and
        paginate the results.


        ## Query Parameters


        The following query parameters can be used to customize the request:


        - `id` (optional): The unique identifier for a specific stream.
            
        - `userId` (optional): The identifier of the user associated with the
        streams.
            
        - `url` (optional): The URL of the stream.
            
        - `isInactive` (optional): A boolean flag to filter streams that are
        inactive.
            
        - `isShowMine` (optional): A boolean flag to indicate whether to show
        streams owned by the requesting user.
            
        - `limit` (optional): The maximum number of results to return in the
        response.
            
