  /report:
    get:
      tags:
        - Report
      summary: Get users reports
      description: >-
        ## Endpoint Description


        This endpoint retrieves reports based on various query parameters. It
        allows clients to filter and paginate through reports, providing
        flexibility in fetching specific data.


        ### Request


        **Method:** GET  

        **URL:** `{{hostDocker}}/report`


        #### Query Parameters


        - `id` (optional): The unique identifier for a specific report.
            
        - `userId` (optional): The identifier for the user associated with the
        report.
            
        - `title` (optional): The title of the report to filter results.
            
        - `recordUrl` (optional): The URL associated with the report.
            
        - `withItems` (optional): A flag indicating whether to include report
        items in the response.
            
        - `isShowMine` (optional): A flag to show only reports created by the
        requesting user.
            
        - `page` (optional): The page number for pagination.
            
        - `limit` (optional): The number of reports to return per page.
            

        ### Response


        The response will be a JSON object with the following structure:


        - `success` (boolean): Indicates whether the request was successful.
            
        - `result` (array): An array of report objects, which may be empty if no
        reports match the criteria.
            

        #### Report Object Structure


        Each report object in the `result` array contains the following fields:


        - `id` (string): The unique identifier for the report.
            
        - `title` (string): The title of the report.
            
        - `description` (string): A brief description of the report.
            
        - `userId` (string): The identifier for the user who created the report.
            
        - `thumbnailUrl` (string): URL for the report's thumbnail image.
            
        - `recordUrl` (string): URL for accessing the report.
            
        - `expiryTimeInMinutes` (integer): The time until the report expires, in
        minutes.
            
        - `calculatedClass` (string): A calculated classification for the
        report.
            
        - `createdDate` (string): The date when the report was created.
            
        - `updatedDate` (string): The date when the report was last updated.
            
        - `reportItems` (array): An array of items associated with the report,
        where each item contains:
            
            - `id` (string): The unique identifier for the report item.
                
            - `data` (string): The data related to the report item.
                
            - `reportId` (string): The identifier of the report to which the item belongs.
                
            - `createdDate` (string): The date when the report item was created.
                
            - `updatedDate` (string|null): The date when the report item was last updated (may be null).
                

        ### Example Responses


        1. {"success":true,"result":\[\]}
            
        2.
        {"success":true,"result":\[{"id":"","title":"","description":"","userId":"","thumbnailUrl":"","recordUrl":"","expiryTimeInMinutes":0,"calculatedClass":"","createdDate":"","updatedDate":"","reportItems":\[{"id":"","data":"","reportId":"","createdDate":"","updatedDate":null}\]}\]}
            
        3.
        {"success":true,"result":\[{"id":"","title":"","description":"","userId":"","thumbnailUrl":"","recordUrl":"","expiryTimeInMinutes":0,"calculatedClass":"","createdDate":"","updatedDate":""}\]}
            

        This endpoint is useful for applications that require dynamic access to
        reports based on user-specific criteria and pagination.
