    post:
      tags:
        - Report
      summary: Create report
      description: >-
        ## POST /report


        This endpoint is used to create a new report. It accepts a JSON payload
        containing details about the report, including its title, description,
        associated stream ID, and expiry time in minutes.


        ### Request Body


        The request body must be in JSON format and include the following
        parameters:


        - **title** (string): The title of the report. This should provide a
        brief overview of the report's content.
            
        - **description** (string): A detailed description of the report,
        explaining its purpose and context.
            
        - **streamId** (string): The unique identifier for the stream associated
        with the report.
            
        - **expiryTimeInMinutes** (integer): The duration in minutes for which
        the report is valid before it expires.
            

        #### Example Request Body


        ``` json

        {
          "title": "testing new minute",
          "description": "recording for minute",
          "streamId": "b5f796dd-935f-431a-95b4-e7a04e...",
          "expiryTimeInMinutes": 1
        }

         ```

        ### Response Structure


        Upon a successful request, the API will respond with a status code of
        200 and a JSON object indicating the success of the operation. The
        response will include the following fields:


        - **success** (boolean): Indicates whether the report creation was
        successful.
            
        - **result** (object): Contains detailed information about the created
        report and associated entities:
            
            - **id** (string): The unique identifier for the report.
                
            - **isPredictionEnabled** (boolean): Indicates if prediction features are enabled for the report.
                
            - **path** (string): The path to the report.
                
            - **streamId** (string): The ID of the stream associated with the report.
                
            - **userId** (string): The ID of the user who created the report.
                
            - **reportId** (string): The ID of the report.
                
            - **expiryDate** (string or null): The expiry date of the report.
                
            - **expiryTimeInMinutes** (integer): The expiry time in minutes.
                
            - **createdDate** (string): The date when the report was created.
                
            - **updatedDate** (string or null): The date when the report was last updated.
                
            - **user** (object): Information about the user who created the report:
                
                - **id** (string): The unique identifier for the user.
                    
                - **email** (string): The email address of the user.
                    
                - **name** (string): The name of the user.
                    
                - **roles** (array): An array of roles assigned to the user.
                    
                - **isVerified** (boolean): Indicates if the user is verified.
                    
                - **createdDate** (string): The date when the user was created.
                    
                - **updatedDate** (string or null): The date when the user was last updated.
                    
                - **photo** (string or null): The URL of the user's profile photo.
                    
            - **report** (object): Contains details about the report:
                
                - **id** (string): The unique identifier for the report.
                    
                - **title** (string): The title of the report.
                    
                - **description** (string): The description of the report.
                    
                - **userId** (string): The ID of the user who created the report.
                    
                - **thumbnailUrl** (string or null): The URL of the report's thumbnail.
                    
                - **recordUrl** (string or null): The URL of the recorded report.
                    
                - **expiryTimeInMinutes** (integer): The expiry time in minutes.
                    
                - **calculatedClass** (string or null): The calculated class for the report.
                    
                - **createdDate** (string): The date when the report was created.
                    
                - **updatedDate** (string or null): The date when the report was last updated.
                    
            - **stream** (object): Information about the associated stream:
                
                - **id** (string): The unique identifier for the stream.
                    
                - **url** (string): The URL of the stream.
                    
                - **userId** (string): The ID of the user who owns the stream.
                    
                - **inactive** (boolean): Indicates if the stream is inactive.
                    
                - **createdDate** (string): The date when the stream was created.
                    
                - **updatedDate** (string): The date when the stream was last updated.
                    

        #### Example Response


        ``` json

        {
          "success": true,
          "result": {
            "id": "",
            "isPredictionEnabled": true,
            "path": "",
            "streamId": "",
            "userId": "",
            "reportId": "",
            "expiryDate": null,
            "expiryTimeInMinutes": 0,
            "createdDate": "",
            "updatedDate": null,
            "user": {
              "id": "",
              "email": "",
              "name": "",
              "roles": [""],
              "isVerified": true,
              "createdDate": "",
              "updatedDate": null,
              "photo": null
            },
            "report": {
              "id": "",
              "title": "",
              "description": "",
              "userId": "",
              "thumbnailUrl": null,
              "recordUrl": null,
              "expiryTimeInMinutes": 0,
              "calculatedClass": null,
              "createdDate": "",
              "updatedDate": null
            },
            "stream": {
              "id": "",
              "url": "",
              "userId": "",
              "inactive": true,
              "createdDate": "",
              "updatedDate": ""
            }
          },
          "message": ""
        }

         ```
